import React, { Component } from 'react';

function FunctionalComponent() {
  return (
    <div>
      <h1>Hello World</h1>
    </div>
  )
}




export class ClassComponent extends Component {
  render() {
    return (
      <div>
        <h1>Hello World</h1>
      </div>
    )
  }
}

export default {FunctionalComponent, ClassComponent};
